import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import ArrowBackIosIcon from '@material-ui/icons/ArrowBackIos';
import { useRouter } from "next/router";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    textAlign:"center",
    fontFamily:'sans-serif',
  },
}));

export default function MenuAppBar() {
  const classes = useStyles();
  const [anchorEl, setAnchorEl] = React.useState(null);
  const router = useRouter();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{backgroundColor:'info'}}>
        <Toolbar>
          {/* <IconButton edge="start" className={classes.menuButton} color="red" aria-label="menu"> */}
            <ArrowBackIosIcon onClick={() => {router.back()}} style={{cursor:'pointer'}}/>
          {/* </IconButton> */}
          <Typography variant="h4" className={classes.title}>
            Insurdinary Insurance Advice
          </Typography>
        </Toolbar>
      </AppBar>
    </div>
  );
}
